import asyncImport from '../app/HOCs/asyncImport'

const TeacherPage = asyncImport(() => import('./Teacher'))
const StudentPage = asyncImport(() => import('./Student'))
const TopPage = asyncImport(() => import('./TopPage'))

export {
  TeacherPage,
  StudentPage,
  TopPage
}
